import { Fragment } from "react";
import Cart from "../Cart/Cart";
import styles from "./Navbar.module.scss";

const Navbar = () => {
  return (
    <Fragment>
      <div className={styles.input}>
        <input type="text" placeholder="Search" />
      </div>

      <Cart />
    </Fragment>
  );
};

export default Navbar;
